import { Container, Row, Col, Button } from "react-bootstrap";
import { connect } from "react-redux";
import { userLogout } from "../../store/actions/authActions";

const Logout = ({ userLogout, history }) => {
  console.log(history);

  const handleSubmit = (e) => {
    console.log(e);
    e.preventDefault();
    userLogout();
    history.push("/home");
    window.location.reload();
  };

  return (
      <div style={{display: 'flex',  justifyContent:'center', alignItems:'center', backgroundColor:'blue', w }}>
        <Container>
          <Row>
            <Col sm={1}>
              <Button sm={3} variant="primary" onClick={handleSubmit}>
                Yes
              </Button>
            </Col>
            <Col sm={1}>
              <Button sm={3} variant="primary" onClick={history.goBack}>
                No
              </Button>
            </Col>
          </Row>
        </Container>
      </div>
  );
};

const mapDispatchToProps = (dispatch) => {
  return {
    userLogout: () => {
      dispatch(userLogout());
    },
  };
};
export default connect(null, mapDispatchToProps)(Logout);
